// export default Profile
import React from 'react';
import './Profile.css';
import profileImage from './path/to/your/image.jpg'; // Import your image

function Profile() {
  return (
    <div className='Profile'>
      <img src={profileImage} alt="Profile Image" />
      <h1>Keshavapatteri m</h1>
      {/* Other content */}
    </div>
  );
}

export default Profile;
